INSERT INTO `cornellevents` VALUES('Caldwell Hall', '341', '1384923600', '1:45pm-3:00pm', 'Lunch', 'Flipping an Undergraduate Science Course: Engaging Students to Promote Deeper Learning and Academic Success', 'true', 'Teaching a class of 100+ students involves many challenges, from logistics to assessment to management. However, meaningful and engaging learning can still take place in large classes. Join us for a webinar about the results of using "flipped classroom" methodology in an introductory microbiology course.  A "flipped classroom" is one in which students learn new content outside of class, and complete assigned problems in class with personalized teacher guidance.  This is the third session of a monthly online series about teaching large classes of undergraduate science, technology, engineering, and mathematics (STEM) students.\n\nCoffee and snacks will be provided. RSVP appreciated to cu-cirtl@cornell.edu, but drop-ins are always welcome! \n\nCan''t make the group viewing? You can also participate from your own computer at: www.cirtl.net/cirtlcasts (headset or earbuds recommended).\n\nSponsored by the Center for the Integration of Research, Teaching, and Learning (CU-CIRTL) in the Graduate School.\n\nA flipped classroom methodology was used in an introductory microbiology course and compared to a traditionally taught course. Collaborative group learning activities were the focus of class time, and included discussion of the solutions, while lectures were delivered via podcast outside of class time. In both formats, students completed reflective blogs about the activities and group work to elucidate changes in attitude and motivation resulting from the new teaching strategy.');
INSERT INTO `cornellevents` VALUES('Appel Commons', 'Northstar, third floor', '1384923600', '6:30pm-7:30pm', 'Dinner', 'Balch Hall Community Dinner - Birthday Bash', '', 'Hosted by FIR Paul Merrill at Appel on the third floor. Join your fellow residents, Residential Staff, Faculty, and special guests. We will honor all Balchies with birthdays and Paul will serenade everyone with a studio track and live performance of Happy Birthday on trumpet!');
INSERT INTO `cornellevents` VALUES('Caldwell Hall', '341', '1385010000', '12:45pm-2:00pm', 'Lunch', 'Not Just for Students with Disabilities: Using Universal Design to Help All Students Learn', 'true', 'Take a late lunch break to join a group viewing of this online coffee hour series focusing on how to effectively teach the diverse students in your science and mathematics classes. \n\nThis is the third session in the new series, "Leveraging Diversity in STEM Education," which addresses issues of classroom and social context in science, technology, engineering, and mathematics education.\n\nLight lunch and drinks will be provided, along with the chance to ask questions via videoconference with other CIRTL Network institutions. RSVP appreciated to cu-cirtl@cornell.edu, but drop-ins are always welcome!\n\nYou can also participate from your own computer at: www.cirtl.net/coffeehour (headset or earbuds recommended). \n\nSponsored by the Center for the Integration of Research, Teaching, and Learning (CU-CIRTL) in the Graduate School.');
INSERT INTO `cornellevents` VALUES('Southside Community Center', 'None', '1385010000', '6:00pm-7:30pm', 'Dinner', 'CULTURA - Antojitos - Cooking Series', 'true', 'LASP is excited to announce the triumphant return of CULTURA''S popular Antojitos cooking series! Join us to learn how to make food from the Dominican Republic! Although the class is FREE (donation for materials encouraged), space is limited so pre-registration is encouraged. Email culturaithaca@gmail.com to sign up.');
INSERT INTO `cornellevents` VALUES('Physical Sciences Building', 'Clark Atrium', '1385096400', '7:00pm-9:00pm', 'Dinner', 'So You Think You Can Adobo?', 'true', 'A cooking competition for Typhoon Haiyan relief!\n\nCome taste the delicious diversity of the Philippines'' unofficial national dish. For only $5, attendees may sample and help judge which dish they believe is the tastiest variation on Chicken Adobo, and the proceeds will go directly to Oxfam America and disaster relief. Through this event, we can celebrate a beautiful aspect of Filipino culture while simultaneously aiding our kababayans, or fellow-citizens, in the Philippines.');
INSERT INTO `cornellevents` VALUES('Appel Commons', 'Northstar', '1385269200', '12:30pm-12:30pm', 'Lunch', 'Beth''s Brunch', '', 'Join Balch Faculty Fellow, Beth Milles and her family of three, for an informal brunch at Appel on the third floor. Just show up and say hi!\n\nBeth Milles is an Associate Professor in the Department of Performing and Media Arts at Cornell University. Recent directing work includes the world premiere of alumna Lauren Feldmans play A PEOPLE, THE CHERRY ORCHARD (a site specific installation production ) DEAD MANS CELL PHONE (Trinity Repertory Company in Providence ,RI), THE IMPORTANCE OF BEING EARNEST (Trinity Repertory Company) and LAZARUS DISPOSED (Perishable Theatre).  Other work includes writer/director Tim Robbins and Adam Simon''s CARNAGE for The Actor''s Gang in Los Angeles and a new adaptation of Molieres THE BOURGEOIS GENTLEMAN with her students at Cornell University in collaboration with composer Lewis Flinn, and Carson Kreitzers FLESH AND THE DESERT for the Summer Play Festival in New York City. Beth directed the world premiere of NERO: ANOTHER GOLDEN ROME at the Magic Theatre in San Francisco developed in collaboration with playwright Steven Sater and composer Duncan Sheik  (workshopped initially with her students at Cornell). She directed the West Coast premiere of Carson Kreitzers SELF DEFENSE at The Actors Gang Theatre in Los Angeles (3 LA Weekly Awards), Julia Sweeney''s "GOD SAID HA on Broadway at the Lyceum Theatre, SHE STOOPS TO CONQUER at Shakespeare Santa Cruz, A CERTAIN LABOR DAY, written by and starring Carroll O'' Connor at The Union Square Theatre in San Francisco. Beth adapted and directed THE IMAGINARY INVALID at the Actors Gang Theater in LA which toured at The Rushmore Festival (4 LA Ovation Awards including Best Adaptation).\n\nBeth is currently developing a site specific installation clown piece with Cirque du Soleil Artist and collaborator Daniel Passer entitled THE INFINITE INFINITESIMAL FANTASIA: a performance of epic proportions.');
